import './Header.css';
import logo from './logo.png';

const Header = () => {
  return (
    <header>
      <nav> 
        <ul>
          <li><div className="logo-container">
            <img src={logo} alt="Logo" className="logo" />
        </div> </li>  
          <li>Home</li>
          <li>About</li>
        </ul>
      </nav>
    </header>
  );
};

export default Header;
